//react
import React from 'react'
import { slide as Menu } from 'react-burger-menu';

//styled
import Outer from './styled/Outer'

export default props => {
	return (
		<Outer>
			<Menu>
				<a className="menu-item" href="/"><i id="home" class="fa fa-home fa-2x">Home</i></a>
				<a className="menu-item" href="/about">About Me</a>
				<a className="menu-item" href="/skills">Skills</a>
				<a className="menu-item" href="/experience">Experience</a>
				<a className="menu-item" href="/katas">Coding Katas</a>
				<div>
					<a className="menu-item--small" href="/katas/babysitter">Baby Sitter Kata</a>
				</div>
			</Menu>
		</Outer>
	);
};
